        abstract: "西门子自1872年进入中国，140余年来以创新的技术、卓越的解决方案和产品坚持不懈地对中国的发展提供全面支持，并以出众的品质和令人信赖的可靠性、领先的技术成就、不懈的创新追求，确立了在中国市场的领先地位。2015财年（2014年10月1日至2015年9月30日），西门子在中国的总营收达到69.4亿欧元，拥有超过32000名员工，20个研发中心、77家运营企业*。西门子已经发展成为中国社会和经济不可分割的一部分，并竭诚与中国携手合作，共同致力于实现可持续发展。"
        ,content: "<p>\t<a href=\"https://baike.baidu.com/item/%E8%A5%BF%E9%97%A8%E5%AD%90%E8%82%A1%E4%BB%BD%E5%85%AC%E5%8F%B8/5621671\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">西门子股份公司</a>是全球领先的技术企业，创立于1847年，业务遍及全球200多个国家，专注于电气化、自动化和数字化领域。</p><p>\t西门子自1872年进入中国，140余年来以创新的技术、卓越的解决方案和产品坚持不懈地对中国的发展提供全面支持，并以出众的品质和令人信赖的可靠性、领先的技术成就、不懈的创新追求，确立了在中国市场的领先地位。2015财年（2014年10月1日至2015年9月30日），西门子在中国的总营收达到69.4亿欧元，拥有超过32000名员工，20个研发中心、77家运营企业*。西门子已经发展成为中国社会和经济不可分割的一部分，并竭诚与中国携手合作，共同致力于实现可持续发展。<span style=\"color: rgb(51, 102, 204);\">&nbsp;[1]</span><span style=\"color: rgb(19, 110, 194);\">&nbsp;</span></p><p class=\"ql-align-justify\">\t该数据系指西门子在中国开展持续运营的公司。</p><p class=\"ql-align-justify\"><br></p><h3>勇担责任</h3><p>\t致力于符合道德规范的、负责任的行为</p><p>\t西门子努力满足一切法律和道德要求，并且，只要可能，我们还努力超越这些要求。我们的责任是按照最高的职业和道德标准和惯例来开展业务：公司绝不容忍任何不合规的行为。</p><p>\t我们在“勇担责任”方面的原则堪称我们制定业务决策的指南针。我们还必须鼓励我们的商业伙伴、供应商和其他利益相关者遵循同样高的道德标准。</p><h3>追求卓越</h3><p>\t取得卓越的业绩和运营成果。</p><p>\t追求卓越，是我们在每个业务都将尽力实现的目标。我们根据公司愿景制定这一远大目标，并在其指引下提供优异的质量及超越客户需求的解决方案。一直如此。</p><p>\t追求卓越还意味着吸引市场上最优秀的人才。我们将帮助这些人才掌握获得成功所需的各种技能，给他们提供发挥潜力的绝佳机会。我们致力于营造一种高绩效企业文化。</p><p>\t追求卓越不仅仅关系到我们今天所做的一切，它还要求我们找到一条持续改善的道路。这需要我们灵活、积极地迎接变革，从而确保我们能够牢牢把握新的机遇。</p><h3>矢志创新</h3><p>\t敢于创新，创造可持续的价值。</p><p>\t创新就已成为西门子业务成功的基石。研发是西门子发展战略的基本动力。作为关键专利的持有者，无论是已经成熟的工艺，还是正在发展的技术，我们都是客户强有力的合作伙伴。我们的目标是，在所涉足的众多业务，都占据技术领袖地位。</p><p>\t我们是创新惠及全球的企业公民。我们用客户是否成功来衡量我们的创新是否成功。我们不断调整业务组合，以便为全人类共同面临的最严峻的挑战提供解决方案，从而使我们得以创造可持续的价值。</p><p class=\"ql-align-justify\">\t通过引领潮流，我们可以完全释放员工的能量和创造力。我们富于独创，也欣赏这种素质的所有含义：独创性、创造力、奇思妙想，等等。</p>"
